import '../App.css';
import { Button } from './Button';
import './About.css';

function AboutSection() {
  return (
    <div className='about-container'>


      <h3>Founder: Adrian Hough</h3>
      <p>London-based Finance and Technology professional with a Bachelor of Commerce from the University of Melbourne (Australia) and an MBA from SDA Bocconi (Italy).</p>
      <p>Finance, Risk and Change experience from institutions such as Deutsche Bank, RBC Capital and Bank of America.</p>

    </div>
  );
}

export default AboutSection;
